import React, { useState } from 'react';
import { createCommerce } from '../services/commerceService';

const CommerceForm = () => {
  const [form, setForm] = useState({
    Ruc: '',
    NombreComercial: '',
    RazonSocial: '',
    Direccion: '',
    Telefono: '',
    NombreContacto: '',
    TipoEstablecimiento: 'Restaurante',
    ImagenLogotipo: ''
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createCommerce(form);
      alert('Comercio creado exitosamente');
    } catch (error) {
      alert('Error al crear comercio');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" name="Ruc" placeholder="Ruc" value={form.Ruc} onChange={handleChange} required />
      <input type="text" name="NombreComercial" placeholder="Nombre Comercial" value={form.NombreComercial} onChange={handleChange} required />
      <input type="text" name="RazonSocial" placeholder="Razón Social" value={form.RazonSocial} onChange={handleChange} required />
      <input type="text" name="Direccion" placeholder="Dirección" value={form.Direccion} onChange={handleChange} required />
      <input type="text" name="Telefono" placeholder="Teléfono" value={form.Telefono} onChange={handleChange} required />
      <input type="text" name="NombreContacto" placeholder="Nombre Contacto" value={form.NombreContacto} onChange={handleChange} required />
      <select name="TipoEstablecimiento" value={form.TipoEstablecimiento} onChange={handleChange} required>
        <option value="Restaurante">Restaurante</option>
        <option value="Transporte">Transporte</option>
        <option value="Hotel">Hotel</option>
        <option value="Motel">Motel</option>
      </select>
      <input type="text" name="ImagenLogotipo" placeholder="URL Imagen Logotipo" value={form.ImagenLogotipo} onChange={handleChange} />
      <button type="submit">Crear Comercio</button>
    </form>
  );
};

export default CommerceForm;
